module.exports = /*#__PURE__*/JSON.parse('{"archive":{"blogPosts":[{"id":"/releases/10.0.0","metadata":{"permalink":"/pr-preview/pr-571/blog/releases/10.0.0","source":"@site/blog/releases/10.0.0/index.mdx","title":"Release 10.0.0","description":"Nya funktioner","date":"2025-05-15T00:00:00.000Z","tags":[],"readingTime":1.67,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 10.0.0","date":"2025-05-15T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"nextItem":{"title":"Release 9.0.0","permalink":"/pr-preview/pr-571/blog/releases/9.0.0"}},"content":"## Nya funktioner\\n\\nMedium size components\\n\\n## Migrera från x.x.x till 10.0.0\\n\\n### Accordion\\n\\nAccordion har inte längre stöd för prop `type` för att ha flera AccordionItems öppna samtidigt. Använd\\n`allowsMultipleExpanded` istället\\n\\n```diff\\n- <Accordion type=\'multiple\'>/* items */</Accordion>\\n+ <Accordion allowsMultipleExpanded>/* items */</Accordion>\\n```\\n\\n### Button\\n\\nButton har inte längre stöd för `size=\'small\'`. Däremot introduceras storleken `medium` och det går att välja\\nmellan `\'large\'` och `\'medium\'`, där medium är default.\\n\\n```diff\\n//highlight-next-line\\n-   <Button size=\'small\'></Button> // this is no longer valid\\n+   <Button size=\'medium\'></Button>\\n\\n```\\n\\n### Modal, DialogTrigger\\n\\nVarianten med ModalTrigger och Dialog är nu utfasad och istället ska DialogTrigger och Modal användas. En aning\\nförvirrande men principen är liknande och den uppdaterade versionen innehåller många förbättringar.\\nSe dokumentationen för [modal](/components/modal) för hur DialogTrigger används.\\n\\n```diff\\n- import {Dialog, ModalTrigger} from \'@midas-ds/components\' // no longer works\\n+ import {DialogTrigger, Modal} from \'@midas-ds/components\'\\n```\\n### Spinner\\n\\nFrån och med 10.0.0 går det inte längre att använda prop `dark`, använd `ìsOnColor` istället.\\n\\n```diff\\n- <Spinner dark/>\\n+ <Spinner isOnColor/>\\n```\\n\\n### Tabs\\n\\nAnvänd `defaultSelectedKey` istället för `defaultSelectedKey`.\\n\\n```diff\\n- <Tabs defaultSelected={1}> /* tab content */ </Tabs>\\n+ <Tabs defaultSelectedKey={1}> /* tab content */ </Tabs>\\n```\\n### Table\\n\\nProp `narrow` försvinner. Ny variant för desktopanpassad storlek kommer i senare release.\\n\\n### Tokens\\n\\nTokens `borderInvalid` ersätts med `supportBorderWarning` och `textInvalid` ersätts med `textWarning`.\\n\\n```diff\\n- semantic.borderInvalid\\n+ semantic.supportBorderWarning\\n- semantic.textInvalid\\n+ semantic.textWarning\\n\\n```\\n\\n### useMessageFormatter\\n\\n`useMessageFormatter` försvinner till förmån för `useLocalizedStringFormatter` eftersom den är deprecated hos React Aria.\\n\\n```diff\\n- useMessageFormatter()\\n+ useLocalizedStringFormatter()\\n```\\n\\n### Label\\n\\nLabel variant försvinner i version 10.0.0, det går alltså inte längre att använda `variant=\'label-01\'` eller `label-02`.\\nDefault är numera `label-02` och för att uppnå variant `label-01`, använd komponent `Text` med `slot=\'description\'`.\\n\\n```diff\\n- <Label variant=\'label-01\'>Label</Label>\\n+ <Text slot=\'description\'>Label</Label>\\n```\\n\\n### Skeleton\\n\\nNamnfix på prop `rectangular` som numera heter `rectangle` för en mer konsekvent semantik. Animering är numera endast en\\nboolean, `isAnimated=true|false`.\\n\\n```diff\\n- <Skeleton variant=\'rectangular\' animation=\'wave\'/>\\n+ <Skeleton variant=\'rectangle\' isAnimated />\\n```\\n\\nSe alla förändringar i detalj på [changelog](/changelog)\\n\\n{/* truncate */}"},{"id":"/releases/9.0.0","metadata":{"permalink":"/pr-preview/pr-571/blog/releases/9.0.0","source":"@site/blog/releases/9.0.0/index.mdx","title":"Release 9.0.0","description":"Migrera från 8.x.x till 9.0.0","date":"2025-05-08T00:00:00.000Z","tags":[],"readingTime":0.68,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 9.0.0","date":"2025-05-08T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 10.0.0","permalink":"/pr-preview/pr-571/blog/releases/10.0.0"}},"content":"## Migrera från 8.x.x till 9.0.0\\n\\nStrukturen på tokens för `lineHeight` och `size` under `typography` har ändrats.\\nImporterar du dessa värden behöver du justera din kod enligt:\\n\\n### lineHeight\\n\\n```tsx\\nimport { typography } from \'@midas-ds/components/theme\'\\n```\\n\\n```diff\\n-   typography.lineHeight01\\n+   typography.lineHeight10\\n-   typography.lineHeight02\\n+   typography.lineHeight20\\n-   typography.lineHeight03\\n+   typography.lineHeight30\\n-   typography.lineHeight04\\n+   typography.lineHeight40\\n-   typography.lineHeight05\\n+   typography.lineHeight50\\n-   typography.lineHeight06\\n+   typography.lineHeight60\\n-   typography.lineHeight07\\n+   typography.lineHeight70\\n-   typography.lineHeight08\\n+   typography.lineHeight80\\n-   typography.lineHeight09\\n+   typography.lineHeight90\\n-   typography.lineHeight10\\n+   typography.lineHeight100\\n```\\n\\n### size\\n\\n```tsx\\nimport { typography } from \'@midas-ds/components/theme\'\\n```\\n\\n```diff\\n\\n-   typography.size01\\n+   typography.fontSize10\\n-   typography.size02\\n+   typography.fontSize20\\n-   typography.size03\\n+   typography.fontSize30\\n-   typography.size04\\n+   typography.fontSize40\\n-   typography.size05\\n+   typography.fontSize50\\n-   typography.size06\\n+   typography.fontSize60\\n-   typography.size07\\n+   typography.fontSize70\\n-   typography.size08\\n+   typography.fontSize80\\n-   typography.size09\\n+   typography.fontSize90\\n-   typography.size10\\n+   typography.fontSize100\\n\\n```\\n\\nKolla [changelog](/changelog/9.0.0)\\n\\n{/* truncate */}"}]}}');

